// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmIcon 
} from '@vime/core';

import { define } from '../lib';


define('vm-icon', VmIcon);


export interface IconProps extends JSX.VmIcon, HTMLAttributes<HTMLVmIconElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmIconElement, IconProps>(
  'vm-icon',
  new Set(['name','src','label','library','icons']),
);
